import React from 'react';


class Login extends React.Component{
    componentDidMount() {
        document.title = 'Login';
    }

    render() {
        const form =
            <>
                <div className="row justify-content-center mt-5">

                    <div className="d-block col-lg-8 col-md-8 col-sm-10 col-xl-8 border">
                        <h1>
                            this is the login page
                        </h1>
                         <form method="POST" action="#">
                              <div className="row form-group justify-content-center">
                                 <input type="email" name="email" className="form-control mt-2 " /> <br/>
                                 <input type="password" name="password" className="form-control mt-2" />
                                     <br/>
                                  <input type="submit" className="button-form bg-primary mt-5" />
                              </div>
                         </form>
                        <input type="button" className="button bg-primary" value="Bootsrap" />
                    </div>
                </div>

                </>;

        return (form);
    }
}

export default Login;
